import React, { useState } from "react";
import "./App.css";

import data from "./data/data.json";

interface dataProps {
  id: string;
  name: string;
  dni: string;
}

function App() {
  const [searchInput, setSearchInput] = useState("");
  const [foundCristi, setFoundCristi] = useState<any>([
    {
      id: "",
      name: "",
      dni: "",
    },
  ]);

  const doctorSearch = () => {
    if (searchInput == null) return;
    const foundCristi = data.filter((user) => {
      return user.dni.toLowerCase().includes(searchInput.toLowerCase());
    });

    setFoundCristi(foundCristi);
  };
  console.log("data", data);
  console.log("foundCristi", foundCristi);
  console.log("valueeee", searchInput);

  return (
    <div className="App">
      <header className="App-header"></header>
      <main>
        <form>
          <input
            type="search"
            onChange={(e) => setSearchInput(e.target.value)}
          />
          <button type="button" onClick={() => doctorSearch()}>
            Search
          </button>
        </form>
        <ul>
          {foundCristi.map((person: any, index: number) => (
            <li key={index}>{person.name}</li>
          ))}
        </ul>
      </main>
    </div>
  );
}

export default App;
